import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function App() {

  let [title, b] = useState('Best Coffee in Boston');
  let [likes, changeLikes] = useState(0);

  return (
    <div className="App">
      <nav className="black-nav">
        <h4>{ title }</h4>
      </nav>
      <NavBar/>
      <section className='list'>
        <h4>{ title } <span onClick={() => {changeLikes(likes + 1)}}>üëç</span> {likes} </h4>
        <p>2022</p>
      </section>
      <Quote/>
    </div>
  );
}

function Quote(){
  return(
    <div class="quote">
      <p>This is a quote</p>
      <p class="quoteAuthor">Author is</p>
    </div>
  )

  function NavBar(){
    return(
      <nav>
        <ul>
          <li>Home</li>
          <li>Resume</li>
          <li>Blog</li>
        </ul>
      </nav>
    )
  }
}

export default App;
